            {/*                    lng: interaction.coordinates[1]*/}
            {/*                }}*/}
            {/*                onClick={() => {*/}
            {/*                    setSelectedInteraction(interaction)*/}
            {/*                    console.log(selectedInteraction)*/}
            {/*                }}*/}
            {/*                icon={*/}
            {/*                    !interaction.complete && (PicIncomplete) ||*/}
            {/*                    interaction.complete && (PicComplete)*/}
            {/*                }*/}
            {/*            />*/}
            {/*        </div>*/}
